import React from 'react';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import main from "./pages/Main"

const App =() => {
  return(
    <Router>
      <Routes>
        <Route path="/" element={<main />}></Route>
      </Routes>
    </Router>
  );
};
export default App;
